export default function Icon({ className, type, ...rest }) {
  if (icons[type] === undefined) {
    console.error('Invalid Icon type.');
    return null;
  }

  return (
    <span
      className={cn({
        [styles.icon]: true,
        [type]: type,
        [className]: className,
      })}
      {...rest}
    >
      {icons[type]}
    </span>
  );
}
